                                    <div className="col-sm-3 col-md-3">
                                        {
                                            this.props.user.users.data ? (
                                                <>
                                                    <CSVLink filename={"user_request.csv"} className="btn btn-primary ml-3" data={data} headers={this.state.headers}>
                                                        CSV Download 
                                                    </CSVLink>
                                                    <CSVLink filename={"user_request.xls"} className="btn btn-primary ml-3" data={data} headers={this.state.headers}>
                                                    XLS Download 
                                                    </CSVLink>
                                                </>
                                            ) : null
                                        }

                                    </div>
                                </div>

                            </div>
                        </div>

                        <div className="row">
                            <div className="col-md-12">
                                <div className="card">
                                    <div className="card-body">
                                        <div className="table-responsive">
                                            <table className="table table-hover table-center mb-0 datatable">
                                                <thead>
                                                    <tr>


                                                        <th>#</th>
                                                        <th>{i18n.t('name')}</th>
                                                        <th>{i18n.t('email')}</th>
                                                        <th>Admin</th>
